import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        WikiPages Analyzer
      </header>
      <nav class="navbar">
            <ul >
              <li class="active"><a href="#">Task 1</a></li>
              <li><a href="#">Task 2</a></li>
              <li><a href="#">Task 3</a></li>
              <li><a href="#">Task 4</a></li>
            </ul>

        </nav>

      <body>
        <div id="root" border="1"> </div>

      </body>
    </div>
  );
}


export default App;
